(15,	37,	3,	6,	2,	'crayfish_party.jpg',	'Kräftskiva – en sensommartradition',	'http://www.finlande.nl/public/default.aspx?contentid=114234&nodeid=35916&contentlan=3&culture=sv-FI',	' De varma kvällarna i augusti-september lockar till traditionell kräftskiva. Kräftfisket i fria vatten börjar den 21 juli kl. 12.00 och slutar den sista oktober. Sensommarens kräftskivsdelikatess är kräftor med rostat bröd. Kräftorna kokas levande tillsammans med dillkronor och serveras kalla dekorerade med dillkvistar. Man skalar räkorna med hjälp av en speciell kräftkniv och äter dem för hand genom att suga och sörpla. Små vattenskålar och pappershanddukar hjälper till att hålla händerna rena. Typiskt för en finländsk kräftskiva är att kräftorna utgör huvudrätten och inget annat behövs. Drycker som passar kräftkalas är öl, vittvin och snaps. Numera är lyktor, servetter, dukar och annan rekvisita med kräftmotiv en del av kräftkalaset, likaså glada snapssånger och tal. Lite om kräftfiskets historia Kokta kräftor åt man redan under antiken men inte som en delikatess utan för att man trodde att kräftorna kunde lindra allslags sjukdomar. I Europa började man äta kräftor i klostren under medeltiden. Klosterlivet omfattade närmare tvåhundra fastedagar då det var tillåtet att förtära enbart vegetarisk föda och fisk. Kräftorna gav omväxling i kosten. I Finland blev kräftorna populära bland de högre stånden i mitten av 1500-talet. Modet att äta kräftor kom till Finland från Sverige. En del av traditionerna kan härstamma från St. Petersburg, då den ryska societeten besökte Finland för att ”bada” och äta bland annat kräftor. Sånger till kräftskivan Glada sånger, framför allt snapsarna till ära, är en kräftskivstradition.\r\n ',	1,	0),
(16,	37,	3,	6,	7,	'crayfish_party.jpg',	'Crayfish dishes',	'http://www.finlande.nl/public/default.aspx?contentid=114234&nodeid=35916&contentlan=3&culture=sv-FI',	'This stunning lobster dish is surprisingly simple to make. Lobster shells are stuffed with cooked lobster in a creamy white wine sauce, then topped with Parmesan cheese and broiled until golden. This stunning lobster dish is surprisingly simple to make. Lobster shells are stuffed with cooked lobster in a creamy white wine sauce, then topped with Parmesan cheese and broiled until golden.This stunning lobster dish is surprisingly simple to make. Lobster shells are stuffed with cooked lobster in a creamy white wine sauce, then topped with Parmesan cheese and broiled until golden.This stunning lobster dish is surprisingly simple to make. Lobster shells are stuffed with cooked lobster in a creamy white wine sauce, then topped with Parmesan cheese and broiled until golden.\n\n\n\n',	1,	0);
